import React from "react";
import styled from "styled-components";
import ETH from "../assets/token/eth.png";

const tokenRow = styled.div`
  .img {
    width: 32px;
    height: 32px;
    border-radius: 50%;
    border: 1px solid #333;
    padding: 4px;
    margin-left: 12px;
  }
  .name {
    font-size: 24px;
    line-height: 24px;
    font-weight: bold;
    margin-left: 6px;
  }
`;

export default function ModalToken(token) {
  return (
    <tokenRow>
      <img className="img" src={ETH} alt="" />
      <span className="name">ETH</span>
    </tokenRow>
  );
}
